import React from 'react';
import { FlexPlugin } from '@twilio/flex-plugin';
// import {ReactComponent as ReactLogo} from './assets/screen.svg';
const PLUGIN_NAME = 'StateWarningPlugin';

export default class StateWarningPlugin extends FlexPlugin {
  constructor() {
    super(PLUGIN_NAME);
  }

  async init(flex, manager) {
    //Change logo via link
    // flex.MainHeader.defaultProps.logoUrl = "https://images.unsplash.com/photo-1671884891930-205e2a9c18a0?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=776&q=80";

    /*Change logo via base64
      1.Need to image to base64
      2.https://www.base64-image.de/
    */
    flex.MainHeader.defaultProps.logoUrl = `data:image/png;base64,`
    flex.NoTasksCanvas
    .Content
    .add(
      <div style={{ color: "red", padding: 20 }} key="warning">
        You are not available to receive tasks!
      </div>,
      {
        if: props => props.worker.activity.available === false
      });
  }
}